(function() {
    'use strict';

    var appControllers = angular.module('app.controllers', []);

    appControllers.controller('BaseSearchCtrl', function() {
        var vm = this;
        vm.results = '';
        vm.query = '';
        vm.orderProp = 'name';
    });

    appControllers.controller('DetailController', function(searchService, $scope) {
        $scope.modalData = searchService.getData();
        console.log($scope.modalData);
    });
}());
(function() {
    'use strict';

    var appDirectives = angular.module('app.directives', []);

    appDirectives.directive('appVersion', ['version', function(version) {
        return function(scope, elm) {
            elm.text(version);
        };
    }]);
}());

(function() {
    'use strict';

    var appDirectives = angular.module('app.directives');

    appDirectives.directive('searchInput', ['searchService', '$location', function(searchService, $location) {
        return {
            restrict: 'E',
            transclude: true,
            replace: true,
            scope: {
                results: '=ngModel',
                order: '=orderProp',
                query: '=value'
            },
            template: [
                '<div>',
                    '<form name="searchForm" novalidate ng-submit="search(searchForm.$valid, query, 0)">',
                        '<div class="form-group search-area"><input autofocus="" name="searchBox" id="searchBox" ng-model="query" type="search" placeholder="Search thousands of beers..." required value="" class="form-control searchBox"></div>',
                    '</form>',
                    '<label ng-show="results.data.length>0" class="sort-by-options">Sort by:',
                        '<select ng-change="changedvalue()" id="option" ng-model="order">',
                            '<option value="name">Name</option>',
                            '<option selected="selected" value="abv">% ABV</option>',
                            '<option selected="selected" value="style.ibuMax">IBU(High to Low)</option>',
                            '<option selected="selected" value="style.ibuMin">IBU(Low to High)</option>',
                        '</select>',
                    '</label>',
                '</div>'
            ].join(''),
            link: function(scope) {
                scope.changedvalue = function() {
                    console.log(scope.order);
                    scope.option = true;
                };
                scope.isLoading = false;
                scope.search = function(valid, query, startIndex) {
                    if (valid) {
                        scope.isLoading = true;
                        searchService.searchBeers(query, startIndex).then(function(resp) {
                            console.log(resp);
                            scope.results = resp;
                            scope.isLoading = false;
                            $location.search('q', query);
                        });
                    }
                };
                if ($location.search().q !== undefined) {
                    scope.query = $location.search().q;
                    scope.search(true, $location.search().q, 0);
                }
            }
        };
    }]);
}());

(function() {
    'use strict';

    var appDirectives = angular.module('app.directives');

    appDirectives.directive('searchResultsWeb', ['searchService', '$location', '$modal', function(searchService, $location, $modal) {
        return {
            restrict: 'E',
            transclude: true,
            scope: {
                results: '=ngModel',
                order: '=orderProp'
            },
            templateUrl:'App/Templates/search-results.html',
            link: function(scope, $rootScope) {
                scope.currentPage = 1;
                scope.showDetails = function(data) {
                    searchService.setData(data);
                    $rootScope.modalInstance = $modal.open({
                        templateUrl: 'App/Templates/details.html',
                        size: 'lg',
                        controller: 'DetailController',
                        resolve: {}
                    });
                    $rootScope.modalInstance.result.then(function() {
                    }, function() {
                    })['finally'](function() {
                        $rootScope.modalInstance = undefined;
                    });
                };
                scope.changePage = function(startIndex) {
                    var query = $location.search().q;
                    searchService.searchBeers(query, startIndex - 1).then(function(resp) {
                        console.log(resp);
                        scope.results = resp;
                    });
                };
            }
        };
    }]);
}());

(function() {
    'use strict';

    var appFilters = angular.module('app.filters', []);

    appFilters.filter('sanitize', ['$sce', function($sce) {
        return function(htmlCode) {
            return $sce.trustAsHtml(htmlCode);
        };
    }]);
}());

(function() {
    'use strict';

    var appServices = angular.module('app.services', []);
    appServices.factory('searchService', ['$http', '$q', function($http, $q) {
        var API_KEY = '34413dca2e90874d297dc41d77bb527a';
        var BASE_URL = 'https://api.brewerydb.com/v2/';
        var maxResults = 20;
        var modalData = null;
        var searchService = {
            searchBeers: searchBeers,
            setData: setData,
            getData: getData
        };

        function setData(data) {
            modalData = data;
        }

        function getData() {
            return modalData;
        }

        function searchBeers(query, startIndex) {
            var url = BASE_URL + 'search?type=beer&q=' + query + '&key=' + API_KEY;
            var deferred = $q.defer();
            $http.get(url).success(function(resp) {
                deferred.resolve(resp);
            }).error(function() {
                deferred.resolve(-1);
            });
            return deferred.promise;
        }
        return searchService;
    }]);
}());
